THE ALEX JONES SHOW 
2010.03.05 Friday

Alex welcomes back to the show Gerald Celente, trend forecaster, publisher of the Trends Journal, business consultant and author who makes predictions about the global financial markets and other events of historical importance. In 2009, Celente predicted turmoil which he described as &quot;Obamageddon&quot; and believes the Tea Party movement and tax protests are harbingers of revolution. Alex also talks with Wayne Paul, the brother of Texas Congressman Ron Paul, and regular guest Bob Chapman, publisher of The International Forecaster.

HOUR 1: News, false flags and staged events, PNAC Project for New American
Century, Pentagon shooting, etc.

HOUR 2: IMF style austerity measures coming to America, global bunkruptcy for
global government dependency, society's masters play with words, Russia an
angel compared to China and Northern Korea, Kremlin, communism good for women?,
Mao being worshipped?, WAYNE PAUL

HOUR 3: Wayne Paul has case against the IRS, individuals contracting with
eachother using gold as form of exchange - not taxable folks, gold bullion act,
silver eagle act, don't place your hard work and wealth into fiat currency,
BOB CHAPMAN, domestic devaluation of currency globally, Greece update, U.S. next,
Joseph Stiglitz declares federal reserve is corrupt and undermining USA,
New World Order is coming - do you want bondage or freedom?, riots in Indonesia,
Ted Anderson

HOUR 4: Finish with Bob Chapman, *** GERALD CELENTE ***, trend predictions, 
this country needs to reclaim its greatness by depending on eachother not
through more government - wars and military empirialism, total collapse coming?

